import React, { Component } from "react";
import Navigation from "../components/Navigation";
import Projects from "../components/Projects";
import dataExp from "../data/dataExp";
import ProjectsExp from "../components/ProjectsExp";

class Knowledges extends Component {
  state = {
    languages: [
      { id: 2, techno: "HTML ", icon: "fab fa-html5 text-red", xp: 1.98 },
      { id: 3, techno: "Scss ", icon: "fab fa-sass", xp: 1.95 },
      { id: 1, techno: "Javascript ", icon: "fab fa-js-square", xp: 1.2 },
      { id: 4, techno: "Bootstrap ", icon: "fab fa-bootstrap", xp: 2 },
      { id: 5, techno: "Reactjs ", icon: "fab fa-react", xp: 1.5 }
    ],
    Outils: [
      { id: 6, techno: "Illustrator ", icon: "fas fa-bezier-curve", xp: 2 },
      { id: 7, techno: "Photoshop ", icon: "far fa-file-image", xp: 2 },
      { id: 8, techno: "Git & Github ", icon: "fas fa-code-branch", xp: 1.78 },
      { id: 9, techno: "Docker ", icon: "fab fa-docker", xp: 1.5 },
      { id: 10, techno: "VS Code ", icon: "far fa-file", xp: 1.6 }
    ],
    data: dataExp
  };
  render() {
    let { languages, Outils, data } = this.state;
    return (
      <>
        <Navigation />
        <div className="col-xl  ">
          <div className="w-50">
            <h1 className="profile display-4 fw-bolder">Knowledges</h1>
            <Projects
              languages={languages}
              title="Languages"
              className="fw-bolder mt-4"
            />
            <Projects
              languages={Outils}
              title="Outils"
              className="fw-bolder mt-4"
            />

            <ProjectsExp
              data={data}
              title="Experiences"
              className="fw-bolder mt-5"
            />
          </div>
        </div>
      </>
    );
  }
}

export default Knowledges;
